BEGIN;
ALTER TABLE timeline_entries ADD COLUMN timeline_item_id INTEGER;
UPDATE timeline_entries set timeline_item_id = (SELECT id FROM timeline_items where timeline_entries.timeline_item = timeline_items.timeline_item);
END;

ALTER TABLE timeline_entries DROP COLUMN timeline_item;


--Find Errant MIDs that won't transfer

SELECT a.id, a.merchant_id
FROM addresses a
LEFT JOIN merchants m ON a.merchant_id = m.merchant_id
WHERE m.id is null;

 UPDATE virtual_check_webs SET merchant_id = (SELECT id FROM merchants where  merchants.merchant_id = virtual_check_webs.merchant_id);
 UPDATE webpasses SET merchant_id = (SELECT id FROM merchants where  merchants.merchant_id = webpasses.merchant_id);

